package com.tfg.backend.Services;

import java.util.Calendar;
import java.util.Date;
import java.util.List;
import java.util.Optional;
import java.util.Properties;

import javax.mail.Message;
import javax.mail.MessagingException;
import javax.mail.PasswordAuthentication;
import javax.mail.Session;
import javax.mail.Transport;
import javax.mail.internet.InternetAddress;
import javax.mail.internet.MimeMessage;

import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.scheduling.annotation.Scheduled;
import org.springframework.stereotype.Service;

import com.sun.mail.smtp.SMTPTransport;
import com.tfg.backend.Daos.IAdoptionAnimalDao;
import com.tfg.backend.Daos.IPreferencesDAO;
import com.tfg.backend.Daos.IUserDao;
import com.tfg.backend.Entities.AdoptionAnimal;
import com.tfg.backend.Entities.Animal;
import com.tfg.backend.Entities.Preferences;
import com.tfg.backend.Entities.Profile;
import com.tfg.backend.Entities.User;

@Service
public class MailService implements IMailService {

    // for example, smtp.mailgun.org
    private static final String SMTP_SERVER = "smtp.gmail.com";
    private static final String USERNAME = "adoptappplatform@gmail.com";
    private static final String PASSWORD = "chrispaul8";

    private static final String EMAIL_FROM = "adoptappplatform@gmail.com";
    private static final String EMAIL_TO = "cerotresdoce@hotmail.com";
    private static final String EMAIL_TO_CC = "";

    private static final String EMAIL_SUBJECT = "Test Send Email via SMTP";
    private static final String EMAIL_TEXT = "Hello Java Mail \n ABC123";

    @Autowired
    IPreferencesDAO preferencesDAO;
    @Autowired
    IAdoptionAnimalDao adoptionAnimalDAO;
    @Autowired
    IUserDao userDAO;

    @Override
    @Scheduled(cron = "* * * * 7 ?")
    public void sendSummaries() {
	List<Preferences> preferences = preferencesDAO.findBySummary(true);
	Calendar calendar = Calendar.getInstance();
	calendar.add(Calendar.DAY_OF_YEAR, -7);
	preferences.forEach((preference) -> {
	    List<AdoptionAnimal> adoptionAnimals = adoptionAnimalDAO.searchAnimalsByPreferences(preference.getBreed(),
		    preference.getColor(), preference.getSize(), preference.getProfile().getLatitude(),
		    preference.getProfile().getLongitude(), preference.getMaxAdoptionDistance(), calendar);
	    Optional<User> user = userDAO.findById(preference.getProfile().getId());

	    if (!adoptionAnimals.isEmpty()) {
		sendEmail(adoptionAnimals, user.get());
	    }

	});
    }

    public void sendEmail(List<AdoptionAnimal> animals, User user) {

	Properties prop = System.getProperties();
	prop.put("mail.smtp.host", SMTP_SERVER); // optional, defined in SMTPTransport
	prop.put("mail.smtp.auth", "true");
	prop.put("mail.smtp.port", "587"); // default port 25
	prop.put("mail.smtp.socketFactory.port", "465");
	prop.put("mail.debug", "true");
	prop.put("mail.smtp.socketFactory.class", "javax.net.ssl.SSLSocketFactory");
	prop.put("mail.smtp.socketFactory.fallback", "false");

	Session session = Session.getInstance(prop, new javax.mail.Authenticator() {
	    protected PasswordAuthentication getPasswordAuthentication() {
		return new PasswordAuthentication(USERNAME, PASSWORD);
	    }
	});

	try {

	    Message message = new MimeMessage(session);
	    message.setFrom(new InternetAddress(EMAIL_FROM));
	    message.setRecipients(Message.RecipientType.TO, InternetAddress.parse(user.getEmail()));
	    StringBuilder sb = new StringBuilder();

	    message.setSubject("Nuevos animales en adopción");
	    sb.append("<p>Hola " + user.getName() + ",</p>");
	    sb.append("<p>Esta semana se han añadido nuevos animales en adopción que pueden interesarle :</p>");
	    animals.forEach((animal) -> {
		
		String  image = animal.getImages().iterator().next().getImage();
		
		sb.append("<h2>" + animal.getName() + "</h2>");
	//	sb.append("<img width =\"20px\" height=\"20px\" src=\"data:image/jpeg;base64,\">");
		sb.append("<p><b> Raza: : </b>" + animal.getBreed() + "</p>");
		sb.append("<p><b> Color: : </b>" + animal.getColor() + "</p>");
		sb.append("<p><b> Genero: : </b>" + animal.getGenre() + "</p>");
		sb.append("<p><b> Tamaño: : </b>" + animal.getSize() + "</p>");
		sb.append("<p><b> Descripción: : </b>" + animal.getDescription() + "</p>");
		sb.append("<p><b> Mas información : </b><a href = http://adoptapp/" + animal.getBreed()+">Aqui</a></p>");

	    });
	    message.setContent(sb.toString(), "text/html; charset=UTF-8");

	    Transport.send(message);

	    System.out.println("Done");

	} catch (MessagingException e) {
	    e.printStackTrace();
	}
    }
}
